import React from "react";
import Header from "../components/Header";

const StuProfile = () => {
  return (
    <div className="page">
      {/* Internal CSS */}
      <style>{`
        .page {
          padding: 20px;
          font-family: "Segoe UI", Tahoma, Geneva, Verdana, sans-serif;
          background: #f4f6f9;
          min-height: 100vh;
        }

        /* Profile Header */
        .profile-header {
          display: flex;
          align-items: center;
          gap: 15px;
          background: linear-gradient(135deg, #007bff, #00b4d8);
          color: white;
          padding: 20px;
          border-radius: 12px;
          margin-bottom: 20px;
          box-shadow: 0px 3px 8px rgba(0, 0, 0, 0.15);
        }

        .profile-header h2 {
          margin: 0;
          font-size: 22px;
        }

        .student-email {
          font-size: 14px;
          opacity: 0.9;
        }

        .avatar {
          width: 70px;
          height: 70px;
          border-radius: 50%;
          border: 3px solid white;
        }

        /* Reusable Card */
        .card {
          background: #ffffff;
          padding: 20px;
          margin-bottom: 20px;
          border-radius: 12px;
          box-shadow: 0px 2px 6px rgba(0, 0, 0, 0.08);
          transition: transform 0.2s ease-in-out;
        }

        .card:hover {
          transform: translateY(-3px);
        }

        .card h3 {
          margin-bottom: 15px;
          color: #007bff;
          font-size: 18px;
          border-bottom: 2px solid #f1f1f1;
          padding-bottom: 8px;
        }

        /* Info Grid */
        .info-grid {
          display: grid;
          grid-template-columns: repeat(auto-fit, minmax(220px, 1fr));
          gap: 10px;
        }

        .card p {
          margin: 6px 0;
          font-size: 15px;
          color: #444;
        }

        /* Uploaded Documents List */
        .card ul {
          list-style: none;
          padding: 0;
          margin: 0;
        }

        .card ul li {
          padding: 8px 0;
          font-size: 15px;
          border-bottom: 1px solid #eee;
          display: flex;
          justify-content: space-between;
          align-items: center;
        }

        .card ul li:last-child {
          border-bottom: none;
        }

        /* Table Styles */
        .table {
          width: 100%;
          border-collapse: collapse;
          margin-top: 10px;
        }

        .table th,
        .table td {
          padding: 12px 15px;
          text-align: left;
          border-bottom: 1px solid #eee;
          font-size: 14px;
        }

        .table th {
          background: #007bff;
          color: white;
          font-weight: 600;
        }

        .table tr:hover {
          background: #f1f5ff;
        }

        /* Status badges */
        .status {
          padding: 4px 10px;
          border-radius: 6px;
          font-size: 13px;
          font-weight: 600;
          display: inline-block;
        }

        .status.uploaded {
          background: #c3e6cb;
          color: #155724;
        }

        .status.missing {
          background: #f8d7da;
          color: #721c24;
        }

        .status.applied {
          background: #ffeeba;
          color: #856404;
        }

        .status.shortlisted {
          background: #b8daff;
          color: #004085;
        }
      `}</style>

      {/* Page Header */}
      <Header title="👤 Student Profile" />

      {/* Profile Header */}
      <div className="profile-header">
        <img
          src="https://i.pravatar.cc/100?img=12"
          alt="Student Avatar"
          className="avatar"
        />
        <div>
          <h2>John Doe</h2>
          <p className="student-email">john@example.com</p>
        </div>
      </div>

      {/* Personal Information */}
      <div className="card">
        <h3>Personal Information</h3>
        <div className="info-grid">
          <p><strong>Phone:</strong> 9876543210</p>
          <p><strong>Course Interested:</strong> Full Stack Development</p>
          <p><strong>Enrollment ID:</strong> STU2025-001</p>
          <p><strong>Joined On:</strong> 2025-08-01</p>
        </div>
      </div>

      {/* Uploaded Documents */}
      <div className="card">
        <h3>Uploaded Documents</h3>
        <ul>
          <li>📄 ID Proof: <span className="status uploaded">Uploaded</span></li>
          <li>📑 Marksheet: <span className="status uploaded">Uploaded</span></li>
          <li>🖼️ Photo: <span className="status missing">Not Uploaded</span></li>
        </ul>
      </div>

      {/* Applications */}
      <div className="card">
        <h3>Applications</h3>
        <table className="table">
          <thead>
            <tr>
              <th>Course</th>
              <th>Status</th>
              <th>Date Applied</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>Full Stack Development</td>
              <td><span className="status shortlisted">Shortlisted</span></td>
              <td>2025-08-10</td>
            </tr>
            <tr>
              <td>Data Science</td>
              <td><span className="status applied">Applied</span></td>
              <td>2025-08-15</td>
            </tr>
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default StuProfile;
